-- Bảng SINHVIEN
CREATE TABLE SINHVIEN (
    MASV VARCHAR2(20) PRIMARY KEY,
    HOTEN VARCHAR2(100),
    PHAI CHAR(1),
    NGSINH DATE,
    DCHI VARCHAR2(256), 
    DT VARCHAR2(15),
    KHOA VARCHAR2(10),
    TINHTRANG VARCHAR2(100)
);
ALTER TABLE SINHVIEN ADD CONSTRAINT CS_SINHVIEN_PHAI CHECK (PHAI IN ('1', '0'));
-- NHANVIEN: 4000
ALTER TABLE SINHVIEN
MODIFY TINHTRANG VARCHAR2(100);

-- Bảng HOCPHAN
CREATE TABLE HOCPHAN (
    MAHP VARCHAR2(10) PRIMARY KEY,
    TENHP VARCHAR2(100),
    SOTC NUMBER,
    STLT NUMBER,
    STTH NUMBER,
    MADV VARCHAR2(10),
    FOREIGN KEY (MADV) REFERENCES DONVI(MADV)
);

-- Bảng MOMON
CREATE TABLE MOMON (
    MAMM VARCHAR2(20) PRIMARY KEY,
    MAHP VARCHAR2(10),
    MAGV VARCHAR2(10),
    HK NUMBER,
    NAM NUMBER,
    FOREIGN KEY (MAHP) REFERENCES HOCPHAN(MAHP),
    FOREIGN KEY (MAGV) REFERENCES NHANVIEN(MANV)
);

-- Bảng DANGKY
CREATE TABLE DANGKY (
    MASV VARCHAR2(20),
    MAMM VARCHAR2(10),
    DIEMTH NUMBER,
    DIEMQT NUMBER,
    DIEMCK NUMBER,
    DIEMTK NUMBER,
    PRIMARY KEY (MASV, MAMM),
    FOREIGN KEY (MASV) REFERENCES SINHVIEN(MASV),
    FOREIGN KEY (MAMM) REFERENCES MOMON(MAMM)
);
-- DIEMTK: => DIEMQT*20% + DIEMTH*30% + DIEMCK*50%



-- SINHVIEN
-- NVCB
DECLARE
  ho  SYS.ODCIVARCHAR2LIST := SYS.ODCIVARCHAR2LIST(
    'Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng', 'Võ', 'Đặng', 'Bùi', 'Đỗ', 'Hồ'
  );
  ten SYS.ODCIVARCHAR2LIST := SYS.ODCIVARCHAR2LIST(
    'An', 'Bình', 'Chi', 'Dũng', 'Hùng', 'Mai', 'Lan', 'Hương', 'Minh', 'Thảo', 'Nam', 'Khoa', 'Hải', 'Tâm', 'Thắng'
  );
BEGIN
  FOR i IN 300..799 LOOP
      MANV, HOTEN, PHAI, NGSINH, LUONG, PHUCAP, DT, VAITRO, MADV
    ) VALUES (
      'NV' || LPAD(i, 5, '0'),
      ho(MOD(i, ho.COUNT) + 1) || ' ' || ten(MOD(i, ten.COUNT) + 1),
      CASE MOD(i, 2) WHEN 0 THEN '1' ELSE '0' END,
      TO_DATE('1985-01-01', 'YYYY-MM-DD') + MOD(i, 7000),
      4000000 + MOD(i * 1111, 8000000),
      500000 + MOD(i * 2222, 3000000),
      '091' || TO_CHAR(1000000 + i),
      'NVCB',
      CASE 
        WHEN MOD(i, 6) = 0 THEN 'TOAN'
        WHEN MOD(i, 6) = 1 THEN 'CNTT'
        WHEN MOD(i, 6) = 2 THEN 'VATLY'
        WHEN MOD(i, 6) = 3 THEN 'SINH'
        WHEN MOD(i, 6) = 4 THEN 'HOA'
        ELSE 'KHKT'
      END
    );
  END LOOP;
  COMMIT;
END;
/
-- GV

DECLARE
  ho  SYS.ODCIVARCHAR2LIST := SYS.ODCIVARCHAR2LIST('Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng');
  ten SYS.ODCIVARCHAR2LIST := SYS.ODCIVARCHAR2LIST('An', 'Bình', 'Chi', 'Dũng', 'Hùng', 'Mai', 'Lan', 'Hương');
BEGIN
  FOR i IN 100..299 LOOP
      MANV, HOTEN, PHAI, NGSINH, LUONG, PHUCAP, DT, VAITRO, MADV
    ) VALUES (
      'NV' || LPAD(i, 5, '0'),
      ho(MOD(i, ho.COUNT) + 1) || ' ' || ten(MOD(i, ten.COUNT) + 1),
      CASE MOD(i, 2) WHEN 0 THEN '1' ELSE '0' END,
      TO_DATE('1990-01-01', 'YYYY-MM-DD') + MOD(i, 365),
      5000000 + MOD(i * 10000, 10000000),
      1000000 + MOD(i * 5000, 5000000),
      '090' || TO_CHAR(1000000 + i),
      'GV',
      CASE 
        WHEN MOD(i, 5) = 0 THEN 'TOAN'
        WHEN MOD(i, 5) = 1 THEN 'CNTT'
        WHEN MOD(i, 5) = 2 THEN 'VATLY'
        WHEN MOD(i, 5) = 3 THEN 'SINH'
        ELSE 'HOA'
      END
    );
  END LOOP;
  COMMIT;
END;
/

